import React, { useState, useRef } from "react";
import { submitScript, getJobStatus } from "./api";

function App() {
  const [script, setScript] = useState("");
  const [jobId, setJobId] = useState("");
  const [status, setStatus] = useState("");
  const [videoUrl, setVideoUrl] = useState("");
  const [error, setError] = useState("");
  const [progress, setProgress] = useState(0);
  const intervalRef = useRef(null);

  const handleSubmit = async () => {
    setError("");
    setVideoUrl("");
    setStatus("提交中...");
    setProgress(0);
    try {
      const id = await submitScript(script);
      setJobId(id);
      setStatus("处理中...");
      setProgress(10);
      pollStatus(id);
    } catch (e) {
      setError("提交失败：" + e.message);
      setStatus("");
    }
  };

  const pollStatus = (id) => {
    intervalRef.current = setInterval(async () => {
      try {
        const res = await getJobStatus(id);
        setStatus(res.status);
        if (res.status === "processing") {
          setProgress((prev) => (prev < 90 ? prev + 10 : 90));
        }
        if (res.status === "finished") {
          setProgress(100);
          setVideoUrl(res.video_path);
          clearInterval(intervalRef.current);
        }
        if (res.status === "failed") {
          setError("生成失败：" + (res.error || "未知错误"));
          setProgress(0);
          clearInterval(intervalRef.current);
        }
      } catch (e) {
        setError("查询失败：" + e.message);
        setProgress(0);
        clearInterval(intervalRef.current);
      }
    }, 3000);
  };

  return (
    <div style={{
      maxWidth: 600,
      margin: "40px auto",
      fontFamily: "system-ui, sans-serif",
      background: "linear-gradient(135deg, #6a82fb 0%, #fc5c7d 100%)",
      borderRadius: 16,
      boxShadow: "0 8px 32px rgba(60,60,120,0.15)",
      padding: 32,
      color: "#fff"
    }}>
      <h2 style={{ textAlign: "center", fontWeight: 700, letterSpacing: 2 }}>AI 智能体短视频生成</h2>
      <textarea
        value={script}
        onChange={e => setScript(e.target.value)}
        rows={8}
        cols={60}
        placeholder="请输入要生成视频的脚本..."
        style={{
          width: "100%",
          marginBottom: 16,
          borderRadius: 8,
          border: "none",
          padding: 12,
          fontSize: 16,
          boxShadow: "0 2px 8px rgba(0,0,0,0.08)"
        }}
      />
      <br />
      <button
        onClick={handleSubmit}
        disabled={!script || status === "处理中..."}
        style={{
          background: "linear-gradient(90deg, #43cea2 0%, #185a9d 100%)",
          color: "#fff",
          border: "none",
          borderRadius: 8,
          padding: "10px 32px",
          fontSize: 18,
          fontWeight: 600,
          cursor: !script || status === "处理中..." ? "not-allowed" : "pointer",
          boxShadow: "0 2px 8px rgba(0,0,0,0.12)",
          marginBottom: 16
        }}
      >
        一键生成视频
      </button>
      <div style={{ margin: "12px 0" }}>
        {status && <span>任务状态：{status}</span>}
        {error && <div style={{ color: "#ffd6d6", fontWeight: 600 }}>{error}</div>}
      </div>
      {status === "processing" && (
        <div style={{ margin: "16px 0" }}>
          <div style={{
            background: "#fff3",
            borderRadius: 8,
            height: 18,
            width: "100%",
            overflow: "hidden",
            marginBottom: 4
          }}>
            <div style={{
              width: `${progress}%`,
              height: "100%",
              background: "linear-gradient(90deg, #43cea2 0%, #185a9d 100%)",
              transition: "width 0.5s"
            }} />
          </div>
          <div style={{ textAlign: "right", fontWeight: 600 }}>{progress}%</div>
        </div>
      )}
      {videoUrl && (
        <div style={{ marginTop: 24, textAlign: "center" }}>
          <video src={videoUrl} controls width="480" style={{ borderRadius: 12, boxShadow: "0 2px 16px rgba(0,0,0,0.18)" }} />
          <br />
          <a href={videoUrl} download style={{
            display: "inline-block",
            marginTop: 12,
            background: "#fff",
            color: "#185a9d",
            padding: "8px 24px",
            borderRadius: 8,
            fontWeight: 700,
            textDecoration: "none",
            boxShadow: "0 2px 8px rgba(0,0,0,0.10)"
          }}>下载视频</a>
        </div>
      )}
    </div>
  );
}

export default App;
